import config from '../config/config.json';


const docs = {
    getAllDocs: async function getAllDocs () {
        const response = await fetch(`${config.base_url}/documents`);
        const result = await response.json();
        return result;
    },

    getOneDoc: async function getOneDoc (docs) {
        console.log(docs);
    }
}

export default docs;
